script: |
  super -f text -I q3453.spq | sort > q3453.out

inputs:
  - name: q3453.spq
    data: |
      SELECT col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN NULL AND - col0 + col2 OR col1 / col1 NOT BETWEEN 81 AND ( NULL );
  - name: tab1

outputs:
  - name: q3453.out
    data: |
      59
      68
      96
